const config = {
    transition: '.2s',
    autoLayout: {
        /** 节点间水平间距 */
        horizontalSpacing: 20,
        /** 节点间垂直间距 */
        verticalSpacing: 80,
    },
    canvas: {
        /** 画布宽度 */
        width: 40000,
        /** 画布高度 */
        height: 40000,
    },
    line: {
        /** 线条宽度 */
        strokeWidth: 1,
        strokeLargeWidth: 2,
        /** 箭头宽度 */
        triangleWidth: 10,
        /** 触发区域宽度 */
        triggerWidth: 20,
    },
};

export default config;
